const getNfts = () => {
  fetch('https://api.elrond.com/nfts?collection=EQUISTAR-3f393f')
    .then((response) => response.json())
    .then((data) => {
      const nfts = data;
    });
  const nfts = data;
  console.log(data);
};

export default getNfts;
